import React from 'react';
import {Link} from 'react-router-dom';

const VehicleTerm = (props) => {
    return (
        <div className="card" style="width: 18rem;">
            <img className="card-img-top" src="..." alt="Card image cap"/>
            <div className="card-body">
                <h5 className="card-title">{props.term.brand} {props.term.model}</h5>
                <p className="card-text"> Price: {props.term.price}</p>
            </div>
            <ul className="list-group list-group-flush">
                <li className="list-group-item">Fuel {props.term.fuel}</li>
                <li className="list-group-item">Year {props.term.year}</li>
                <li className="list-group-item">Color {props.term.color}</li>
                <li className="list-group-item">Location {props.term.location}</li>
            </ul>
            <div className="card-body">
                <a title={"Delete"} className={"card-link btn btn-danger"}
                   onClick={() => props.onDelete(props.term.registration)}>
                    Delete
                </a>
                <Link className={"card-link btn btn-info ml-2"}
                      onClick={() => props.onEdit(props.term.registration)}
                      to={`/vehicles/edit/${props.term.registration}`}>
                    Edit
                </Link>
                <Link className={"card-link btn btn-info ml-2"}
                      onClick={() => props.AddProductToCart(props.term.registration)}
                      to={`/cart/add-product/${props.term.registration}`}>
                    Edit
                </Link>
            </div>
        </div>
    )
}

export default VehicleTerm;
